var dbPromise=idb.open("posts-store",1,function(t){t.objectStoreNames.contains("posts")||t.createObjectStore("posts",{keyPath:"id"}),t.objectStoreNames.contains("sync-posts")||t.createObjectStore("sync-posts",{keyPath:"id"})});function writeData(e,r){return dbPromise.then(function(t){t=t.transaction(e,"readwrite");return t.objectStore(e).put(r),t.complete})}function readAllData(e){return dbPromise.then(function(t){return t.transaction(e,"readonly").objectStore(e).getAll()})}function clearAllData(e){return dbPromise.then(function(t){t=t.transaction(e,"readwrite");return t.objectStore(e).clear(),t.complete})}function deleteItemFromData(e,r){dbPromise.then(function(t){t=t.transaction(e,"readwrite");return t.objectStore(e).delete(r),t.complete}).then(function(){console.log("Item deleted!")})}function urlBase64ToUint8Array(t){for(var t=(t+"=".repeat((4-t.length%4)%4)).replace(/\-/g,"+").replace(/_/g,"/"),e=window.atob(t),r=new Uint8Array(e.length),n=0;n<e.length;++n)r[n]=e.charCodeAt(n);return r}function dataURItoBlob(t){for(var e=atob(t.split(",")[1]),t=t.split(",")[0].split(":")[1].split(";")[0],r=new ArrayBuffer(e.length),n=new Uint8Array(r),o=0;o<e.length;o++)n[o]=e.charCodeAt(o);return new Blob([r],{type:t})}